import React from "react";

const Contact = () => {
    return(
        <>
            <div>
                <div>
                <div class="container">
      <div class="contact_head"><h1>Contact Us</h1></div>
      <div class="row">
        <div class="col-10">
          <form action="#" method="get">
            <input type="text"/>
          </form>
        </div>
      </div>
    </div>
                </div>
            </div>
        </>
    )
};

export default Contact;
